def similar_extension(urlList):
    driver_obj = driverExtenstio("similar")

    Resurllist=[]

    for url in urlList:
        driver_obj.get(url)

        set_cookie(drivar_obj=driver_obj, cookie_name="_blka_uab", cookie_value="101")

        driver_obj.refresh()

        page_is_loading(driver_obj)

        # driver_obj.execute_script("alert('page is loaded')")

        time.sleep(20)

        try:
            driver_obj.execute_script(''' return document.querySelector("#similar-extension-host").shadowRoot.querySelector("#extension img[alt='SIMILAR LOGO']").click()''')
            similar_count="similar_present"
            Resurllist.append(similar_count)
            time.sleep(5)
        except:
            similar_count="similar_absent"
            Resurllist.append(similar_count)


        if similar_count=="similar_present":break



    result = Resurllist[-1]

    return result,driver_obj






